import React from "react";
import { View, Text } from "react-native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import HomeScreen1 from "../screens/HomeScreen1";
import HomeScreen2 from "../screens/HomeScreen2";

const HomeStackScreen = () => {
  const HomeStack = createNativeStackNavigator();
  return (
    <HomeStack.Navigator>
      <HomeStack.Screen name="Home1" component={HomeScreen1} />
      <HomeStack.Screen name="Home2" component={HomeScreen2} />
      <HomeStack.Screen name="Home3" component={HomeScreen3} />
      <HomeStack.Screen name="Home4" component={HomeScreen2} />
      <HomeStack.Screen name="Home5" component={HomeScreen2} />
    </HomeStack.Navigator>
  );
};

export default HomeStackScreen;
